// TourCard.jsx
import React from "react";
import { Card, CardBody, CardTitle, CardText } from "reactstrap";

const TourCard = ({ tour }) => {
  return (
    <Card>
      <img src={tour.photo} alt={tour.title} />
      <CardBody>
        <CardTitle tag="h5">{tour.title}</CardTitle>
        <CardText>{tour.desc}</CardText>
        <CardText>
          <small className="text-muted">{tour.city}</small>
        </CardText>
      </CardBody>
    </Card>
  );
};

export default TourCard;
